Stack is allocated on MAIN memory. The stack size for a main thread is 4 KiB. To change the stack size of your main thread, export the following static variable: #[used]
#[export_name = "sceUserMainThreadStackSize"]
pub static SCE_USER_MAIN_THREAD_STACK_SIZE: u32 = 1 * 1024 * 1024; // 1 MiB When creating an new thread, you can set the stack size of it as usual: pub fn main() { std::thread::Builder::new() .stack_size(1 * 1024 * 1024) // 1 MiB .spawn(move || todo!("work")) .expect("Unable to spawn thread") .join() .expect("Unable to join thread");
}

