In some cases (e.g when implementing a custom rasterizer with framebuffers), you may want to allocate memory outside of the heap or MAIN memory. The low-level way to allocate memory on Sony PlayStation Vita is by using a sceKernelAllocMemBlock syscall Here is an example of it may be used: use vitasdk_sys::*; pub struct Buffer { buf: *mut c_void, block_uid: SceUID, size: u32,
} impl Buffer { fn new(size: u32) -> Buffer { let mut buf: *mut c_void = ::core::ptr::null_mut(); // The minimal allocation unit is a memory page let unit = 0x40000 - 1; let size = (size + unit) & !unit; let block_uid = unsafe { let block_uid: SceUID = sceKernelAllocMemBlock( b"display\0".as_ptr() as *const c_char, SCE_KERNEL_MEMBLOCK_TYPE_USER_CDRAM_RW, size, ::core::ptr::null_mut(), ); sceKernelGetMemBlockBase(block_uid, &mut buf); block_uid }; Buffer { buf: buf as _, size, block_uid, } }
} impl Drop for Buffer { fn drop(&mut self) { unsafe { sceKernelFreeMemBlock(self.block_uid); } }
}

