In POSIX the usual way to make a socket non-blocking, or check if it is non-blocking is by using fcntl syscall. Currently this syscall is not implemented in newlib . When porting network libraries for Vita, to change sockets non-blocking flag, or get this flags value, use setsockopt and getsockopt syscalls: fn nonblocking(fd: libc::c_int) -> bool { let mut non_block: libc::c_int = 0; let mut len: libc::socklen_t = 0; unsafe { libc::getsockopt( fd, libc::SOL_SOCKET, libc::SO_NONBLOCK, &mut nonblock as *mut libc::c_int as _, &mut len as _, ); } non_block != 0
} fn set_nonblocking(fd: libc::c_int, non_block: bool) { let non_block = non_block as libc::c_int; unsafe { libc::setsockopt( fd, libc::SOL_SOCKET, libc::SO_NONBLOCK, &non_block as *const libc::c_int as _, std::mem::size_of::<libc::c_int>() as libc::socklen_t, ); }
}

